var certificateModule = (function(){
    
    return {
        generateCertificate: function(data){
            var imageData = "data:image/jpeg;base64,";
            var doc = new jsPDF();
            doc.addImage(imageData, 'JPEG', 15, 40, 180, 160);
            
            //add text
            doc.setFont("times");
            doc.setFontType('italic');
            doc.setTextColor(0,0,0);
            doc.setFontSize(15);
            doc.text(105, 100,'This Certificate is Hereby Awarded to: ','center');
            
            //add name
            var button = event.target;
            var nameField = button.parentElement.previousElementSibling.children[1].children[1];
            var name = nameField.value;
            doc.setTextColor(102, 102, 51);
            doc.setFontSize(22);
            doc.text(105, 110,name,'center');
            
            doc.setTextColor(0,0,0);
            doc.setFontSize(13);
            doc.text(105, 120,'For Achieving Results noted below as documented','center');
            doc.text(105, 125,'and verified by Typing Game ','center');
            
            var level = event.target.getAttribute('level') //most recently event: click the download button
            doc.setFontSize(12);
            doc.text(105, 135,'Leval: ' + level,'center');
            doc.text(105, 140,'Average Speed: '+ data.wpm + ' wpm' ,'center');
            doc.text(105, 145,'Accuracy: ' + data.accuracy + '%','center');
            
            //add date
            var date = new Date();
            date = date.toLocaleDateString('en-US');
            doc.text(130, 165,'Awarded on: ' + date);
            doc.text(130, 170,'TYPING GAME');
            
;            
            
            doc.save('certificate.pdf');
        }
    };
})();